:root {
  --body-bg-color: #f2f3f5;
  --header-bg-color: #3da639;
  --header-fg-color: rgba(255,255,255,0.8);
  --header-fg-hover-color: rgba(255,255,255,1);
  --content-header-color: #34495e;
  /* #000000 */
  --content-text-color: #34495e;
  --content-link-color: #337ab7; }

body {
  background-color: var(--body-bg-color);
  font-family: 'Arbutus Slab'; }

.hero-head {
  background-color: var(--header-bg-color);
  color: var(--header-fg-color); }
  .hero-head .navbar {
    background: transparent; }
  .hero-head a {
    color: var(--header-fg-color); }
    .hero-head a:hover {
      color: var(--header-fg-hover-color); }
    .hero-head a li.buttons {
      padding: 17px 0; }

.buttons a {
  margin-left: 8px; }

.hero-body {
  color: var(--content-text-color); }
  .hero-body a {
    color: var(--content-link-color); }
  .hero-body h1, .hero-body h2, .hero-body h3, .hero-body h4, .hero-body h5, .hero-body h6 {
    color: var(--content-header-color); }
    .hero-body h1 a, .hero-body h2 a, .hero-body h3 a, .hero-body h4 a, .hero-body h5 a, .hero-body h6 a {
      color: var(--content-header-color); }

.hero.is-fullheight .hero-body {
  align-items: start; }

.hero-foot {
  padding: 1rem;
  font-size: 14px; }

@media (max-width: 860px) {
  body {
    font-size: 14px; }
  .content {
    font-size: 14px; } }

@media (max-width: 600px) {
  body {
    font-size: 12px; } }
